falselist=[]
def smartSquare(inlist,inplace):
    if inplace==True:
        for x in range (len(inlist)):
            inlist[x]=inlist[x]*inlist[x]
            truelist.append(inlist[x])
        print(inlist," ",truelist)   
    elif inplace==False:
        for y in range (len(inlist)):
            falselist.append(inlist[y]*inlist[y])
        print(inlist," ",falselist)


